import React, {Component} from "react";

export class Muscle extends Component {
    constructor(props) {
        super(props);
        this.state = {
            muscles: []
        }
    }

    render() {
        return (
            <div>
                <table className="table table-striped">
                    <thead>
                    <tr>
                        <th>
                            MuscleName
                        </th>
                        <th>
                            MuscleCategoryId
                        </th>
                    </tr>
                    </thead>
                    <tbody>
                    {muscles.map(mus =>
                        <tr key={mus.MuscleName}>
                            <td>{mus.MuscleName}</td>
                            <td>{mus.MuscleCategoryId}</td>
                            <td></td>
                        </tr>)}
                    </tbody>
                </table>
            </div>
        )
    }
}
